package main

import (
  "bytes"
  "encoding/base64"
  "fmt"
  "image"
  "image/png"
)

func hamster() image.Image {
  data, err := base64.StdEncoding.DecodeString(hamster_)
  if err != nil {
    panic("invalid base64")
  }

  buf := bytes.NewBuffer(data)

  img, err := png.Decode(buf)
  if err != nil {
    fmt.Println(err)
    panic("invalid png")
  }

  return img
}

const hamster_ = ""
